import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function Home() {
  const [search, setSearch] = useState("");
  const navigate = useNavigate();

  const handleSearch = () => {
    navigate(`/jobs?search=${search}`);
  };

  return (
    <div className="home">
      <div>
        <button>Build Your Future With Us</button>
        <h1>Make Your Dream True With Jobify </h1>
        <p>Search thousands of jobs easily</p>

        <input
          type="text"
          placeholder="Search jobs (React, Frontend...)"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />
        <button onClick={handleSearch}>Search Jobs</button>
        <p>handle with care my soutions</p>
      </div>
      <div class="right">
        <img src="img/hand.jpg" />
      </div>
    </div>
  );
}

export default Home;
